void clicked()
{
    CustDirectDebitMandate custDirectDebitMandateTable;
    CustTrans   CustTrans;
    if (Box::yesNo("@SKS4165", DialogButton::Yes) == DialogButton::Yes)
    {

        custDirectDebitMandateTable = CustDirectDebitMandate::find(custDirectDebitMandate.RecId, true);
        select firstonly CustTrans where CustTrans.DirectDebitMandate == custDirectDebitMandate.recid;
        if(CustTrans)
        {
            error('Cannot delete a mandate with transactions');
            return;
        }
        ttsBegin;
        custDirectDebitMandateTable.delete();
        ttsCommit;

        custTable_ds.research();
        custDirectDebitMandate_ds.research();
    }
}

void clicked()
{
    if (Box::yesNo("@SYS4002547", DialogButton::Yes) == DialogButton::Yes)
    {
        CustDirectDebitMandate::cancelMandate(custDirectDebitMandate.RecId);

        custTable_ds.research();
        custDirectDebitMandate_ds.reread();
        custDirectDebitMandate_ds.refresh();
    }
}
